@app.route('/api/stats')
def aUsersLang():
  mongoc = MongoClient(host = 'localhost')
  data = mongoc.natweet.tweets.aggregate({"$group": {"_id": "$lang", "count": {"$sum": 1}, "coords": {"$addToSet":"$coordinates.coordinates"}}})

  return getJSON(json.dumps(data))

